import * as React from 'react';
import { NavBarListElement } from './NavBarListElement'

interface Props {

}

const myStyle = {
    color: '#FFF',
    display: 'flex',
    // alignItems: 'center',
    justifyContent: 'center',
}

export const NavBarList: React.FC<Props> = () => {
    return ( 
        <div style={myStyle}>
            <NavBarListElement name='Assets' />
            <NavBarListElement name='Trade' />
            <NavBarListElement name='Pay' />
            <NavBarListElement name='For You' />
            <NavBarListElement name='Learn and earn' />
            <NavBarListElement name='Notifications' />
            <NavBarListElement name='Invite Friends' />
        </div>
     );
}
